import React from 'react';
import { TextField, InputAdornment, Tooltip } from '@material-ui/core';


const Input = (props: any): JSX.Element => {
    const { 
        variant, 
        label, 
        type, 
        name, 
        value, 
        error=null, 
        onInput, 
        title,
        icon,
        ...other
    } = props;
    return (
        <TextField
            InputProps={{
                startAdornment: (
                <InputAdornment position="start">
                    <Tooltip title={title}>
                        {icon}
                    </Tooltip>
                </InputAdornment>
                ),
            }}
            variant={variant || "outlined"}
            type={type || "number"}
            label={label}
            name={name}
            value={value}
            onInput={onInput}
            {...(error && {error: true, helperText: error})}
            {...other}
        />
    );
};

export default Input;
